import '../../App.css';

function GameOver(){
    document.body.style = "background: #000";
    return(
        <div className="GameOver">
            <h1>GameOver</h1>
            <button className="btnSendMovie">Comenzar de nuevo</button>
        </div>
    )
}
export default GameOver;
